import logo from './logo.svg';
import './App.css';
import { Router, Route, Switch, Redirect, withRouter, BrowserRouter } from 'react-router-dom';
import {LoginPage} from './Pages/LoginPage';

function App() {
  return (
    <Router>
    <Switch>
      <Route path="/login" component={LoginPage} />
    </Switch>
    </Router>

  )
}

export default App;
